import { Router, Routes, Route } from 'react-router-dom';
import Home from '../routes/Home';
import Detail from '../routes/Detail';

function App() {
  return (
    <Router>
      <Routes>
        <Route exact pathname="/" component={Home} />
        <Route pathname="/:id" component={Detail} />
      </Routes>
    </Router>
  );
}

export default App;
